import React from "react";
import Posts from "./Components/Posts";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Nav from "./Components/Nav";
import "./App.css";

function App() {
  return (
    <Router>
      <div className="App">
        <Nav />

        <Switch>
          <Route path="/" exact component={App} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
